import React from 'react'
import { Button } from 'semantic-ui-react'

const Menu = () => {
  return (
    <>
    <button className="ui button" >New Game</button><label>Score:1</label>
    <Button color='orange'>New Game</Button>
    </>
  )
}

export default Menu
